import React from 'react';
import { Layout } from './Layout';
import { useAuth } from '../../hooks/useAuth';

export const Logout = () => {
    const { setToken } = useAuth();
    const handleLogout = async () => {
        setToken("");
    };

    return <Layout handleLogout={handleLogout} />
}
